ListPropMap (ListingID, PropertyID) AS (
	SELECT LuJunctions.[ListingID], Units.[PropertyID]
    FROM [dbo].[ListingsUnit] AS LuJunctions
    INNER JOIN [dbo].[Unit] AS Units
		ON LuJunctions.[UnitID] = Units.[UnitID]
