    FROM [dbo].[ListingsProperty] AS LpJunctions
	)
SELECT RPID.ListingID,
	LPM.PropertyID,
	LP.ListingPrice,
	LU.UnitID,
	U.BedroomsNumber,
	ltsd.Description AS ListingType,
	ptsd.Description AS PropertyType,
	PA.Longitude AS long,
	PA.latitude AS lat,
	CONCAT(PA.StreetNumberName, ', ', PA.City, ', ', PA.State, ', ', PA.Zip) AS Address,
	NT.NeighborhoodGeneral AS Neighborhood
FROM RelevantPriceID AS RPID
	LEFT JOIN dbo.ListingPrice AS LP
		ON RPID.ListingPriceID = LP.ListingPriceID
	LEFT JOIN dbo.Listings AS L
		ON RPID.ListingID = L.ListingID
	LEFT JOIN dbo.ListingsUnit AS LU
		ON RPID.ListingID = LU.ListingID
	LEFT JOIN dbo.Unit AS U
		ON LU.UnitID = U.UnitID
	LEFT JOIN ListPropMap AS LPM
		ON RPID.ListingID = LPM.ListingID
	LEFT JOIN dbo.Property AS prop
		ON LPM.PropertyID = prop.PropertyID
	LEFT JOIN dbo.PropertyAddress AS PA
		ON LPM.PropertyID = PA.PropertyID
	LEFT JOIN dbo.LookupSubcategoryDetail AS ltsd
		ON L.ListingTypeID = ltsd.PropertyLookupByCategoryID
	LEFT JOIN dbo.LookupSubcategoryDetail AS ptsd
		ON prop.PropertyTypeID = ptsd.PropertyLookupByCategoryID
	LEFT JOIN dbo.NeighborhoodTownship AS NT
		ON prop.PropertyNeighborhoodID = NT.NeighborhoodID
-- Only join Property Address rows that are canonical
WHERE PA.PrimaryAddress = 1
ORDER BY ListingID DESC
